// Header Scroll minified
$(function(){var e=document.querySelector("#mobile-logo"),t=document.querySelector("#main-logo");window.addEventListener("scroll",function(){if(window.pageYOffset>=t.offsetTop+100)return e.classList.add("visible");if(e.classList.contains("visible"))return e.classList.remove("visible")},!1);var o=document.body,i=document.documentElement;Math.max(o.scrollHeight,o.offsetHeight,i.clientHeight,i.scrollHeight,i.offsetHeight)});